    useEffect(async () => {
        const response = await axios.get(`http://localhost:5000/tournament/findOne/${props.match.params.tournamentId}`)
        const data = response.data;
        settournament(data)
    }, [])
    return (
        <div style={{

        }}>
            <img style={{
                width: `100%`
            }} src={`http://localhost:5000/images/tournamentPhoto/${tournament.tournamentPic}`} alt={tournament._id}
            >
                <h1>hello</h1>

            </img>
        </div>
    )
}

export default TournamentDetails
